import './searchBar.css';
import clear from './clear.svg';
import search from './search.svg';
import addUser from './add-user.svg';

const SearchBar = () => {
  return (
    <>
      <div id='searchBar'>
        <img src={search} id='search' className='icon button' />
        <input type="text" placeholder='search' />
        <img src={clear} id='clear' className='icon button' />
      </div>
      <img src={addUser} id='addUser' className='icon button' />
    </>
  );
}

export default SearchBar;
